import React from 'react';
import { Navbar } from 'react-bootstrap';
//Nav, NavItem, Jumbotron, Grid, Row, Col, Image, Button

function Header() {
    return (
        <div className="header">
            <li>Home</li>
            <li>Search</li>
            <li>Library</li>
            <li>Contact</li>
            <li>User</li>
            <li>Log Out</li>
        </div>

    );
}

export default Header;
